file = 'data/21.txt'

class Dot:
    def __init__(self, row, col):
        self.row = row
        self.col = col

    def __repr__(self):
        return "%s-%s" % (self.row, self.col)

out = {}

def propagate(dots, start_point):
    out[start_point] = {}
    current = [start_point]
    previous = None
    nb_moves = 0
    while True:
        out[start_point][nb_moves] = len(current)
        moves = []
        for i in dots:
            found = False
            for dot in current:
                if found:
                    break
                if abs(i.row-dot.row) + abs(i.col-dot.col) == 1:
                    moves.append(i)
                    found = True
        if previous and len(moves) == len(previous) and nb_moves % 2 == 1:
            print(start_point, nb_moves, len(moves))
            return len(moves), nb_moves
        previous = current
        current = moves
        nb_moves += 1

